import React from "react";
import { AppBar, Toolbar } from "@material-ui/core";
export default function Footer() {
  return (
    <header>
      <AppBar style={{ backgroundColor: "#00c8f7", position: "center" }}>
        <Toolbar
          style={{ justifyContent: "center", fontSize: "30px", bottom: 0 }}
        >
          Made by Manish
        </Toolbar>
      </AppBar>
    </header>
  );
}
